    "management-options-for-grassland-areas-at-the-seatuck-national-wildlife-refuge-1990",nt"isopen":
    false,nt"url": null,nt"notes": "There has been a major loss of grassland
    areas on Long Island over the past century. The Seatuck National Wildlife Refuge
    can make a significant contribution to the recovery and protection of grassland
    areas available on Long Island. This Habitat type is important for use by non-game
    migratory birds. This report outlines three management options that would have varying
    grassland improvement impacts. The impacts, costs and potential rewards are described
    for each option.",nt"license_title": "License Not Specified",nt"extras":
